import React from 'react'
import styled from 'styled-components';

function Game() {
    return (
        <Container>
            <ContainerChildLeft>
                <h4>Department</h4>
                <h5>Computers</h5>
                <div>
                    <p>Computer Accessories & Peripherals</p>
                    <p>Computer Components</p>
                    <p>Computers & Tablets</p>
                    <p>Data Storage</p>
                    <p>Laptop Accessories</p>
                    <p>Monitors</p>
                    <p>Networking Products</p>
                    <p>Power Strips & Surge Protectors</p>
                    <p>Printers</p>
                    <p>Scanners</p>
                    <p>Servers</p>
                </div>
               
       
            </ContainerChildLeft>
            <ContainerChildRight>
                <h2>Computers, Tablets and IT Accessories</h2>
                <p>Shop laptops, desktops, monitors, tablets, PC gaming, hard drives and storage, accessories and more</p>
                <div>
                    <p style={{border:'1px solid rgb(236,229,237)', height:'50px', paddingTop: "10px", paddingLeft:"20px"}}>1-12 of over 80,000 results for <span>Computers</span> </p>
                </div>
                <BestSeller>
                <BSeller>
                <p>Amazon Choice</p>
                    <Bs>
                      <img style={{width: "15px", height:"340px", paddingLeft:"20px"}} src="https://m.media-amazon.com/images/I/41S3MKU9TjL._AC_UL320_.jpg" alt="" />
                      <p>Apple Pencil (2nd Generation)</p>
                  </Bs>
                </BSeller>
                  
                  <BSeller>
                  <p>Best Seller</p>
                    <Bs>
                        <img style={{width: "300px", height:"300px"}} src="https://m.media-amazon.com/images/I/71FMdUhizpS._AC_UL480_QL65_.jpg" alt="" />
                        <p>Original HP 63XL Black High-yield Ink Cartridge | Works with HP DeskJet 1112, 2130, 3630 Series; HP ENVY 4510, 4520 Series; HP OfficeJet 3830, 4650, 5200 Series | Eligible for Instan</p>
                    </Bs>
                  </BSeller>
                 
                  <BSeller>
                  <p>Best Seller</p>
                    <Bs>
                        <img src="https://m.media-amazon.com/images/I/81tjLksKixL._AC_UL480_QL65_.jpg" alt="" />
                        <p>Seagate Portable 2TB External Hard Drive Portable HDD – USB 3.0 for PC, Mac, PS4, & Xbox - 1-Year Rescue Service (STGX2000400)</p>
                    </Bs>
                  </BSeller>
                 
                </BestSeller>
            </ContainerChildRight>
        </Container>
    )
}

export default Game

const Container = styled.div`
    display: flex;
`

const ContainerChildLeft = styled.div`
    margin-top:15px;
    width:200px;
    background-color: white;
    padding:10px;
    border-right:1px solid rgb(236,229,237);
    h5{
        margin-left:5px;
    }
    div{
        margin-left:14px;
    }
    
`

const ContainerChildRight = styled.div`
    
    background-color: green;
    flex-grow:1;
    div{
        margin-top: 20px;
        margin-right: 10px;
        margin-left:7px;
        
        height:50px;
        padding-top:15px;
        padding-left:30px;
        p{
            span{
                color: #E67A00;
                text-decoration: none;
            }
        }
    }
`

const BestSeller = styled.div`
    display: flex;
`

const Bs = styled.div`
  flex-grow:1;
  img{
      height:300px;
      width:150px;
      padding:10px;
  }
  p{
      width: 300px;
      
  }
  display: flex;
  flex-direction: column;
  cursor: pointer;
`
const BSeller = styled.div`
    background-color: red;
    p{
     margin-left:-50px;

    }
`
